//import logo from './logo.svg';
import './Navbar.css';

//for class component
import React from "react"

//Navbar class component
class Navbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      bodyTitle: "",
      bodyContents: "",
    };
  }

  clickFunc = (passedLink) => {
    this.setState({bodyTitle: this.props.myobjects[passedLink].title});
    this.setState({bodyContents: this.props.myobjects[passedLink].body});
  };

  render() {
    return (
      <>
      <div className="Navbar">
      <nav class="navbar navbar-default">
        <div class="container-fluid">
          <div class="navbar-header">
            <a class="navbar-brand" href="">React Site</a>
          </div>
          <ul class="nav navbar-nav">
            <li onClick={() => this.clickFunc(0)}><a class="active">{this.props.myobjects[0].title}</a></li>
            <li onClick={() => this.clickFunc(1)}><a>{this.props.myobjects[1].title}</a></li>
            <li onClick={() => this.clickFunc(2)}><a>{this.props.myobjects[2].title}</a></li>
            <li onClick={() => this.clickFunc(3)}><a>{this.props.myobjects[3].title}</a></li>
          </ul>
        </div>
      </nav>
      </div>
      <div className="Body">
       <h3 id="bodyTitle">{this.state.bodyTitle}</h3>
       <p id="bodyContents">{this.state.bodyContents}</p>
      </div>
      </>
    );
  }
}
//
export default Navbar;
